-- ----------------------------
-- Table structure for shop_cart
-- ----------------------------
DROP TABLE IF EXISTS `shop_cart`;
CREATE TABLE `shop_cart`  (
  `id` int NOT NULL AUTO_INCREMENT,
  `shopid` int NOT NULL COMMENT '商品id',
  `userid` int NOT NULL COMMENT '用户id',
  `number` int NULL DEFAULT 1 COMMENT '商品数量',
  `addtime` datetime NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '添加时间',
  `check` int NULL DEFAULT 0 COMMENT '选中状态',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `shopid`(`shopid` ASC, `userid` ASC) USING BTREE,
  INDEX `userid`(`userid` ASC) USING BTREE,
  CONSTRAINT `shop_cart_ibfk_1` FOREIGN KEY (`shopid`) REFERENCES `shop_list` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `shop_cart_ibfk_2` FOREIGN KEY (`userid`) REFERENCES `shop_user` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE = InnoDB AUTO_INCREMENT = 69 CHARACTER SET = latin1 COLLATE = latin1_swedish_ci ROW_FORMAT = DYNAMIC;

