DROP TABLE IF EXISTS `shop_chat`;
CREATE TABLE `shop_chat`  (
  `id` int NOT NULL AUTO_INCREMENT COMMENT 'id',
  `fromid` int NOT NULL COMMENT '发送的用户id',
  `acceptid` int NOT NULL COMMENT '接收的用户id',
  `text` text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '发送的文本',
  `time` datetime NULL DEFAULT NULL COMMENT '发送时间',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `formid`(`fromid` ASC) USING BTREE,
  INDEX `acceptid`(`acceptid` ASC) USING BTREE,
  CONSTRAINT `shop_chat_ibfk_1` FOREIGN KEY (`fromid`) REFERENCES `shop_user` (`id`) ON DELETE NO ACTION ON UPDATE CASCADE,
  CONSTRAINT `shop_chat_ibfk_2` FOREIGN KEY (`acceptid`) REFERENCES `shop_user` (`id`) ON DELETE NO ACTION ON UPDATE CASCADE
) ENGINE = InnoDB AUTO_INCREMENT = 42 CHARACTER SET = latin1 COLLATE = latin1_swedish_ci ROW_FORMAT = DYNAMIC;

