-- Table structure for shop_collect
-- ----------------------------
DROP TABLE IF EXISTS `shop_collect`;
CREATE TABLE `shop_collect`  (
  `id` int NOT NULL AUTO_INCREMENT,
  `shopid` int NOT NULL COMMENT '商品id',
  `username` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '用户名',
  `collectdate` datetime NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '收藏日期',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `shopid`(`shopid` ASC) USING BTREE,
  INDEX `username`(`username` ASC) USING BTREE,
  CONSTRAINT `shop_collect_ibfk_1` FOREIGN KEY (`shopid`) REFERENCES `shop_list` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `shop_collect_ibfk_2` FOREIGN KEY (`username`) REFERENCES `shop_user` (`username`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE = InnoDB AUTO_INCREMENT = 137 CHARACTER SET = latin1 COLLATE = latin1_swedish_ci ROW_FORMAT = DYNAMIC;

