-- ----------------------------
-- Table structure for shop_from
-- ----------------------------
DROP TABLE IF EXISTS `shop_from`;
CREATE TABLE `shop_from`  (
  `id` int NOT NULL AUTO_INCREMENT COMMENT 'id',
  `fromid` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '订单id',
  `status` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '状态',
  `price` decimal(10, 2) NOT NULL COMMENT '价格',
  `time` datetime NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '时间',
  `shopid` int NOT NULL COMMENT '商品id',
  `userid` int NOT NULL COMMENT '用户id',
  `address` text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '收货地址',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `shop_from_ibfk_1`(`userid` ASC) USING BTREE,
  INDEX `shop_from_ibfk_2`(`shopid` ASC) USING BTREE,
  CONSTRAINT `shop_from_ibfk_1` FOREIGN KEY (`userid`) REFERENCES `shop_user` (`id`) ON DELETE NO ACTION ON UPDATE CASCADE,
  CONSTRAINT `shop_from_ibfk_2` FOREIGN KEY (`shopid`) REFERENCES `shop_list` (`id`) ON DELETE NO ACTION ON UPDATE CASCADE
) ENGINE = InnoDB AUTO_INCREMENT = 119 CHARACTER SET = latin1 COLLATE = latin1_swedish_ci ROW_FORMAT = DYNAMIC;

