-- ----------------------------
-- Table structure for shop_list
-- ----------------------------
DROP TABLE IF EXISTS `shop_list`;
CREATE TABLE `shop_list`  (
  `id` int NOT NULL AUTO_INCREMENT COMMENT '商品id号',
  `name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '商品名称',
  `class` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '商品分类',
  `nowprice` float NOT NULL COMMENT '商品当前价格',
  `lastprice` float NULL DEFAULT NULL COMMENT '商品之前价格(可不填)',
  `inventory` bigint NULL DEFAULT NULL COMMENT '库存',
  `indeximg` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '主页推荐图(设了推荐就必须填)',
  `homeimg` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT 'home推荐图(设了推荐就必须填)',
  `shophomeimg` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT 'home列表缩略图',
  `shoplistimg` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '分类列表缩略图',
  `shopinfoimg` text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '商品展示页轮播图，多张图用英文逗号(,)分割',
  `shopinfotitle` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '商品展示页介绍标题',
  `fare` float NULL DEFAULT NULL COMMENT '运费，0或者不填为免运费',
  `introduce` text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '商品详情介绍',
  `shopintroduceimg` text CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL COMMENT '商品展示页介绍图，多张图用英文逗号(,)分割',
  `recommend` int NOT NULL COMMENT '推荐设置(0为不推荐，1为主页推荐，2为home页推荐)取总值',
  `createtime` timestamp NULL DEFAULT current_timestamp COMMENT '创建时间',
  `updatetime` timestamp NULL DEFAULT current_timestamp COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `class`(`class` ASC) USING BTREE,
  CONSTRAINT `shop_list_ibfk_1` FOREIGN KEY (`class`) REFERENCES `shop_two_class` (`name`) ON DELETE SET NULL ON UPDATE CASCADE
) ENGINE = InnoDB AUTO_INCREMENT = 204 CHARACTER SET = latin1 COLLATE = latin1_swedish_ci ROW_FORMAT = DYNAMIC;

