-- ----------------------------
-- Table structure for shop_user
-- ----------------------------
DROP TABLE IF EXISTS `shop_user`;
CREATE TABLE `shop_user`  (
  `id` int NOT NULL AUTO_INCREMENT COMMENT 'id编号',
  `username` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '账号',
  `password` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '用户密码',
  `name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '用户名',
  `email` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '邮箱',
  `headimg` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '头像',
  `phone` bigint NULL DEFAULT NULL COMMENT '手机号码',
  `address` int NULL DEFAULT NULL COMMENT '默认地址id',
  `admin` int NOT NULL DEFAULT 0 COMMENT '0为普通用户，1为后台管理员',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `id`(`id` ASC, `username` ASC) USING BTREE,
  INDEX `username`(`username` ASC) USING BTREE,
  INDEX `shop_user_ibfk_1`(`address` ASC) USING BTREE,
  CONSTRAINT `shop_user_ibfk_1` FOREIGN KEY (`address`) REFERENCES `shop_address` (`id`) ON DELETE NO ACTION ON UPDATE CASCADE
) ENGINE = InnoDB AUTO_INCREMENT = 14 CHARACTER SET = latin1 COLLATE = latin1_swedish_ci ROW_FORMAT = DYNAMIC;

